trailingComments.value:
*
 * 打开书城首页的分类
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @param {Object} params - 调用客户端桥所需要的参数
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('open-app-book-class-page', {
 *   params: {},
 * }).then((info) => {
 *   alert(`[open-app-book-class-page][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[open-app-book-class-page][error] ${JSON.stringify(err, null, 2)}`);
 * });

